function Square() { // component

  const [value, setValue] = useState(null); // value is equal to null

  function handleClick() { // function
    var x = 1
    setValue(x = x + 1); // setValue is a function that transform the var value
    // console.log('clicked!');
  }

  return (
    <button 
      className="square"
      onClick = {handleClick} // activate this function after click
    >
      {value}
    </button>
  );
}

export default function Board() {
    return (
